import './post.css';
const { Component } = require("react");
const { default: SinglePost } = require("../SinglePost/single_post");

class Post extends Component{
    render(){
        return(
            <div class='post-container'>
                <h2>Post Lists</h2>
              <SinglePost title='Post 1' description='post description 1'/> 
              <SinglePost title='Post 2' description='post description 2'/> 
            </div>
        );
    }
}

export default Post
